function getHtml($url){
	ob_start(); 
	readfile($url);
	$output = ob_get_contents(); 
	ob_end_clean(); 	
	$start = stripos($output,'<table id="unopened">');
	$len = stripos($output,'</tbody></table>')-$start;
	return substr($output,$start+29,$len-29);
}
