function crawlhtml($ary,$cateid){
	global $mysql;
	for ($i=0;$i<count($ary);$i++){
		$name = $ary[$i]["name"];
		$url = $ary[$i]["url"];
		$html = mysql_real_escape_string(getHtml($url)); //mysql_real_escape_string
		$sql0 = "SELECT id,htmlid FROM datehtml WHERE url = '$url'";
		$res0 = $mysql->query($sql0);
		if(mysqli_num_rows($res0)>0){
			$id = $mysql->fetch($res0)[1];
		}else{
			$sql = "INSERT htmlcont VALUES ('','$html')";
			$mysql->query($sql);
			$id = mysqli_insert_id($mysql->conn);
		}
		$sql1 = "INSERT datehtml VALUES ('',$cateid,'$name','$url',$id)";
		$mysql->query($sql1);
	}
}
